;; **
;;; ## Model
;; **

;; @@
; Pfau, D., Bartlett, N., & Wood, F. (2011). Probabilistic Deterministic Infinite Automata. In Advances in Neural Information Processing Systems (pp. 1930â€“1938)
(with-primitive-procedures [normalize]
  (defquery pdfa [observedsequence alphabet]
    (let [num-states (sample (categorical [[2 10] [3 6] [4 3] [5 1]]))
          
          emissionprior (fn [] (normalize (repeatedly (count alphabet) (fn [] (sample (uniform-continuous 0 1))))))
          emissiondist (mem (fn [state] (categorical (zipmap alphabet (emissionprior))))) ; \pi

          transitiondist (uniform-discrete 0 num-states)
          transition (mem (fn [state symbol] (sample transitiondist))) ; \delta
          ]
      
      (loop [obs observedsequence
             state [0]]
        (if (not (empty? obs))
          (let [currentstate (peek state)
                _ (observe (emissiondist currentstate) (first obs))
                nextstate (transition currentstate (first obs))]
            (recur (rest obs)
                   (conj state nextstate)))
          (new-pdfa alphabet num-states transition emissiondist))))))
